getRootPath方法 如下
public String getRootPath(String fileName) {
   if (this.isDefineTemp(fileName)) {
     return this.getXFormFileRoot();
   } else if (this.isCommonTemp(fileName)) {
     return this.getXFormFileRoot();
   } else if (this.isExistTemp(fileName)) {
     return this.getXFormExistRoot();
   } else if (fileName.indexOf("xform/upload") > -1) {
     return this.getXFormFileRoot();
   } else {
     return fileName.indexOf("xform/hbm") > -1 ? this.getXFormHbmRoot() : ConfigLocationsUtil.getWebContentPath() + "/";
   }
 }

